import React, { useState } from 'react';

const VortrexPresale = () => {
  const [walletAddress, setWalletAddress] = useState('');
  const [isConnected, setIsConnected] = useState(false);
  const [amount, setAmount] = useState('');
  const [paymentMethod, setPaymentMethod] = useState('USDT');
  const tokenRate = 60000;

  const connectWallet = async () => {
    if (window.ethereum) {
      try {
        const accounts = await window.ethereum.request({
          method: 'eth_requestAccounts',
        });
        setWalletAddress(accounts[0]);
        setIsConnected(true);
      } catch (error) {
        console.error('Wallet connection failed:', error);
      }
    } else {
      alert('Please install MetaMask!');
    }
  };

  const handleAmountChange = (e) => {
    setAmount(e.target.value);
  };

  const handlePaymentMethodChange = (method) => {
    setPaymentMethod(method);
  };

  const buyTokens = () => {
    if (!isConnected || !amount || parseFloat(amount) <= 0) {
      alert('Please connect wallet and enter valid amount.');
      return;
    }
    alert(
      `Buying ${totalTokens} VTX tokens using ${paymentMethod}... (Functionality to be integrated)`
    );
  };

  const totalTokens = amount ? parseFloat(amount) * tokenRate : 0;

  return (
    <div className="min-h-screen bg-black flex items-center justify-center px-4 py-12">
      <div className="bg-gray-900 border-2 border-yellow-400 rounded-3xl shadow-xl w-full max-w-2xl p-6">
        <h1 className="text-3xl font-bold text-yellow-400 mb-6 text-center">Vortrex Token Presale</h1>

        <button
          onClick={connectWallet}
          className="w-full mb-4 bg-gradient-to-r from-purple-600 to-pink-500 hover:scale-105 transition-transform text-white py-3 rounded-full font-semibold"
        >
          {isConnected ? 'Wallet Connected' : 'Connect MetaMask'}
        </button>

        {isConnected && (
          <p className="text-sm text-gray-300 mb-6 break-words text-center">{walletAddress}</p>
        )}

        <div className="grid grid-cols-1 sm:grid-cols-2 gap-4 mb-4">
          <div className="bg-gray-800 p-4 rounded-xl">
            <label className="text-gray-300 mb-2 block">Enter Amount (in USD)</label>
            <input
              type="number"
              value={amount}
              onChange={handleAmountChange}
              className="w-full p-2 border border-yellow-400 rounded bg-black text-white"
              placeholder="Enter Amount"
            />
          </div>
          <div className="bg-gray-800 p-4 rounded-xl flex flex-col justify-center">
            <p className="text-gray-300 mb-1">Total Tokens:</p>
            <p className="text-white text-lg font-bold">{totalTokens}</p>
            <p className="text-sm text-gray-400">1 USDT = 60,000 VTX</p>
          </div>
        </div>

        <div className="bg-gray-800 p-4 rounded-xl mb-4">
          <label className="text-gray-300 block mb-2">Select Payment Method:</label>
          <div className="flex gap-4 flex-col sm:flex-row">
            <button
              onClick={() => handlePaymentMethodChange('USDT')}
              className={`flex items-center gap-2 justify-center px-4 py-2 rounded-full w-full ${
                paymentMethod === 'USDT'
                  ? 'bg-gradient-to-r from-purple-600 to-pink-500'
                  : 'bg-black border border-gray-600'
              } hover:scale-105 transition-transform text-white`}
            >
              <img src="/images/usdt-logo.png" alt="USDT" className="w-6 h-6" /> USDT (BEP-20)
            </button>
            <button
              onClick={() => handlePaymentMethodChange('BNB')}
              className={`flex items-center gap-2 justify-center px-4 py-2 rounded-full w-full ${
                paymentMethod === 'BNB'
                  ? 'bg-gradient-to-r from-purple-600 to-pink-500'
                  : 'bg-black border border-gray-600'
              } hover:scale-105 transition-transform text-white`}
            >
              <img src="/images/bnb-logo.png" alt="BNB" className="w-6 h-6" /> BNB (BEP-20)
            </button>
          </div>
        </div>

        <button
          onClick={buyTokens}
          className="w-full mt-2 bg-gradient-to-r from-yellow-400 to-red-500 hover:scale-105 transition-transform text-black font-bold py-3 rounded-full"
        >
          Buy Tokens
        </button>
      </div>
    </div>
  );
};

export default VortrexPresale;
